import React from 'react'

const Cards = () => {
  return (
    <div className='flex flex-wrap justify-between p-3 mt-2'>
        <div>
         <img className='h-40' src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.canva.com%2Fposters%2Ftemplates%2Fmovie%2F&psig=AOvVaw1yfo712ViqGhjuofiGPPJ3&ust=1677491073401000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCKjAiNnmsf0CFQAAAAAdAAAAABAJ'/>
        </div>
    </div>
  )
}

export default Cards;
